import styled from 'styled-components';

const Header = styled.div `
    background:rgb(0, 0, 0);
    text-align: center;
    padding: 1rem 2rem;
    color: rgb(71, 205, 74);
    font-size: 1rem;
    text-align: left;
    border: 1px solid rgba(255, 255, 255,;
`;

export default Header;
